<div class="entities" style="line-height: 2.5; direction: ltr">A pyrazole curcumin derivative restores membrane homeostasis disrupted after brain trauma . We have assessed potential mechanisms associated with the deleterious effects of TBI on the integrity of plasma membranes in the hippocampus , together with consequences for behavioral function . In addition , we have investigated the efficacy of a dietary intervention based on a pyrazole curcumin derivative with demonstrated bioactivity and brain absorption , to re-establish membrane integrity . We report that moderate fluid percussion injury ( FPI ) increases levels of 4 - Hydroxynonenal ( HNE ) , an intermediary for the harmful effects of lipid peroxidation on neurons . A more direct action of FPI on membrane homeostasis was evidenced by a reduction in calcium-independent phospholipase A2 ( iPLA ) important for metabolism of membrane phospholipids such as 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , and an increase in the fatty acid transport protein ( FATP ) involved in translocation of long-chain fatty acids across the membrane . A potential association between membrane disruption and neuronal function was suggested by reduced levels of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 subunit of the transmembrane DB01221 receptor , in association with changes in iPLA 2 and syntaxin - 3 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - 3 , involved in the action of membrane

 in the treatment of advanced non-small cell lung cancer : translation from preclinical to clinical development . INTRODUCTION : Treatment outcomes in unselected patients with advanced NSCLC remain disappointing with platinum-based chemotherapy . The addition of monoclonal antibodies targeting
